};
const MDXLayout = "wrapper"
export default function MDXContent({
  components,
  ...props
}) {
  return <MDXLayout {...layoutProps} {...props} components={components} mdxType="MDXLayout">

    <p><em parentName="p">{`Do Raid Guild Bots Dream of Electric Tweets?`}</em></p>
    <p>{`The Raid Guild relies on several bots to accomplish different automated tasks. Below is a quick guide to help you get to know how to interact with the different bots you might come across in the `}<a parentName="p" {...{
        "href": "https://discord.gg/RWjkQ6DNnv"
      }}>{`Raid Guild Discord Server.`}</a></p>
    <h2 {...{
      "id": "collabland"
    }}>{`Collab.land`}</h2>
    <blockquote>
      <p parentName="blockquote">{`Collab.Land allows anyone to utilize tokenized community management systems to create incentive alignment, automate processes, and reward participation.`}</p>
    </blockquote>
    <p>{`This bot connects to your wallet and checks to see if you can join certain channels. There are channells in the server that are require tokens to see. `}<a parentName="p" {...{
        "href": "http://collab.Land"
      }}>{`Collab.Land`}</a>{` confirms your access. To engage run:`}</p>
    <pre><code parentName="pre" {...{
        "className": "language-jsx"
      }}>{`!join;
`}</code></pre>
    <p>{`Here's a link to `}<a parentName="p" {...{
        "href": "https://collab.land/"
      }}>{`Collab.land`}</a>{` if you'd like to learn more.`}</p>
    <p><a parentName="p" {...{
        "href": "https://www.youtube.com/watch?v=fiVEyVsR7k8"
      }}>{`Collab.land YouTube video`}</a></p>
    <iframe width="100%" height="500" src="https://www.youtube.com/embed/fiVEyVsR7k8" title="YouTube video player" frameborder="0" allow="accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture" allowfullscreen></iframe>
    <h2 {...{
      "id": "groovy"
    }}>{`Groovy`}</h2>
    <p>{`Groovy is a music playing bot.`}</p>
    <blockquote>
      <p parentName="blockquote">{`Groovy is the quickest way to turn your Discord server into the big stage. Whether you're an upcoming artist, a super star, or a hobby DJ: Sharing music through Discord has never been easier. -`}<a parentName="p" {...{
          "href": "https://groovy.bot/"
        }}>{`https://groovy.bot/`}</a></p>
    </blockquote>
    <p>{`A list of of Groovy commands can be seen below:`}</p>
    <iframe src="https://groovy.bot/commands/" frameborder="0" sandbox="allow-scripts allow-popups allow-top-navigation-by-user-activation allow-forms allow-same-origin" allowfullscreen="" loading="lazy" width='100%' height='500'></iframe>
    <p><a parentName="p" {...{
        "href": "https://groovy.bot/commands"
      }}>{`https://groovy.bot/commands`}</a></p>
    <p><a parentName="p" {...{
        "href": "https://groovy.zendesk.com/hc/en-us/articles/360060721952"
      }}>{`https://groovy.zendesk.com/hc/en-us/articles/360060721952`}</a></p>
    <h2 {...{
      "id": "friend-time"
    }}>{`Friend Time`}</h2>
    <p>{`With Friend Time you can easily coordinate times between users.`}</p>
    <p>{`Friend Time will automatically react with a clock emoji (üï∞Ô∏è) to times mentioned in chat:`}</p>
    <p><a parentName="p" {...{
        "href": "https://docs.friendtime.ml/"
      }}>{`https://docs.friendtime.ml/`}</a></p>
    <p>{`To set your timezone type "-ft map" After that, you will be take to a map where you can select your time zone. Copy the name of your time zone and paste it as a comment.`}</p>
    <pre><code parentName="pre" {...{
        "className": "language-jsx"
      }}>{`-ft set <pasted time zone>
`}</code></pre>
    <h2 {...{
      "id": "brightid-discord-bot"
    }}>{`BrightID Discord Bot`}</h2>
    <p>{`Verify users with Bright ID.`}</p>
    <p><a parentName="p" {...{
        "href": "https://github.com/ShenaniganDApp/brightid-discord-bot"
      }}>{`https://github.com/ShenaniganDApp/brightid-discord-bot`}</a></p>
    <p><a parentName="p" {...{
        "href": "https://discord.com/channels/709210493549674598/747917717050490960/761748220694888478"
      }}>{`https://discord.com/channels/709210493549674598/747917717050490960/761748220694888478`}</a></p>
    <ul>
      <li parentName="ul">{`Created by `}<a parentName="li" {...{
          "href": "https://www.notion.so/YoungKidWarrior-a5025778570f4a558a490978177c5bff"
        }}>{`YoungKidWarrior`}</a></li>
    </ul>
    <p>{`ü§ñ¬†BrightID Bot to verify users in Discord.`}</p>
    <p><a parentName="p" {...{
        "href": "https://bot.brightid.org/"
      }}>{`Click here to Invite BrightID Bot to your server`}</a></p>
    <h3 {...{
      "id": "quick-end-user-guide"
    }}>{`Quick end-user guide`}</h3>
    <p>{`Interacting with the bot is simple; it offers 2 commands`}</p>
    <ul>
      <li parentName="ul">{`"!verify": Sends a QR Code to link the BrightID app to Discord`}</li>
      <li parentName="ul">{`"!me": Adds the "Verified" role to verified users`}</li>
    </ul>
    <h3 {...{
      "id": "to-use-brightid-bot"
    }}>{`To use BrightID Bot:`}</h3>
    <ol>
      <li parentName="ol">{`Type !verify`}</li>
      <li parentName="ol">{`Scan the code (or click the link) BrightID Bot shows you`}</li>
      <li parentName="ol">{`Use an app that has sponsorships. See¬†`}<a parentName="li" {...{
          "href": "https://explorer.brightid.org/apps/index.html"
        }}>{`https://explorer.brightid.org/apps/index.html`}</a></li>
      <li parentName="ol">{`Type !me`}</li>
    </ol>
    <h2 {...{
      "id": "mg-skillbot"
    }}>{`MG-Skillbot`}</h2>
    <p>{`Skillbot is used in the Raid Guild to make it easier for members to connect with people based on their skills. It is used to find people and help other to be found based on your roles in the guild.`}</p>
    <p>{`An excellent tutorial can be found at`}</p>
    <p><a parentName="p" {...{
        "href": "https://hackmd.io/Fs_mnbS3R1qt3MXCyHwwew?view"
      }}>{`https://hackmd.io/Fs_mnbS3R1qt3MXCyHwwew?view`}</a></p>
    <h2 {...{
      "id": "xdai-faucet"
    }}>{`xDai Faucet`}</h2>
    <p>{`xDai Faucet is a place you can recieve xDai deposited to your wallet`}</p>
    <p><a parentName="p" {...{
        "href": "https://xdai-faucet.top/"
      }}>{`https://xdai-faucet.top/`}</a></p>
    <p>{`Made possible by @luigy ùóπùó≤ùó∫ùóºùóª`}</p>
    <h2 {...{
      "id": "sesh"
    }}>{`Sesh`}</h2>
    <p>{`üòÄEZPZ event creation`}</p>
    <ul>
      <li parentName="ul">{`Specify times however the hell you want. No more rigid formats to follow.`}</li>
      <li parentName="ul">{`Simple RSVP via reactions, plus reminders (optional).`}</li>
      <li parentName="ul">{`Wanna play Fortnite in a fortnight? We support you.`}</li>
    </ul>
    <p><a parentName="p" {...{
        "href": "https://sesh.fyi/"
      }}>{`https://sesh.fyi/`}</a></p>
    <p><a parentName="p" {...{
        "href": "https://sesh.fyi/manual/"
      }}>{`https://sesh.fyi/manual/`}</a></p>
    <iframe src="https://sesh.fyi/manual/" frameborder="0" sandbox="allow-scripts allow-popups allow-top-navigation-by-user-activation allow-forms allow-same-origin" allowfullscreen="" loading="lazy" width='100%' height='500'></iframe>
    <h2 {...{
      "id": "suggestion-bot"
    }}>{`Suggestion Bot.`}</h2>
    <p>{`Suggestion bot is a way to submit suggestions or thoughts on how to improve the community. It has anonymity built into it to further support the idea that all participants are welcome and are encouraged to share their input.`}</p>
    <p>{`To engage, DM the bot:`}</p>
    <pre><code parentName="pre" {...{
        "className": "language-jsx"
      }}>{`!suggest <anonymous message>
`}</code></pre>
    <h2 {...{
      "id": "haus-bot"
    }}>{`Haus Bot`}</h2>
    <p>{`This bot is operating on Raid Guild discord channels #dao-verified, #uh-notifications and #haus-of-daos for the convenience of DAO Haus and UBERHAUS in order to keep track of incoming member proposals. It contains variables such as:`}</p>
    <ul>
      <li parentName="ul">{`the name fo the proposal`}</li>
      <li parentName="ul">{`a short description of the proposal`}</li>
      <li parentName="ul">{`the amount of member shares`}</li>
      <li parentName="ul">{`the tribute amount of WXDAI`}</li>
      <li parentName="ul">{`the funding amount`}</li>
      <li parentName="ul">{`the amount of loot shares`}</li>
    </ul>
    <p>{`A link on the panel redirects you to the proposal on app.daohaus.club, where you can see all the details and the actions taken upon it.`}</p>
    <p>{`It is a notification bot that announces new DAO summons & proposals`}</p>
    <p>{`Three cheers to vengist#8655 for creating the bot`}</p>
    <h2 {...{
      "id": "sentry"
    }}>{`Sentry`}</h2>
    <p>{`Sentry bot is built for raid guild‚Äôs own internal purpose and it‚Äôs both a bot and a server`}</p>
    <p><a parentName="p" {...{
        "href": "https://hackmd.io/@saimano/sentry"
      }}>{`https://hackmd.io/@saimano/sentry`}</a></p>
    </MDXLayout>;
}

;
MDXContent.isMDXComponent = true;
